import { connect } from 'react-redux'
import { authenticationError, toggleSignInButton, toggleSignUpButton, userHasLoggedOut } from '../../actions'
import Navbar from './Navbar-container'

const mapStateToProps = state => {
    console.log(state.toggles.then((val) => val.active))
    return {
        active: state.toggles.then((val) => val.active)
    }
}

const mapDispatchToProps = dispatch => {
    return {
        authenticationError: () => dispatch(authenticationError()),
        toggleSignInButton: () => dispatch(toggleSignInButton()),
        toggleSignUpButton: () => dispatch(toggleSignUpButton()),
        userHasLoggedOut: () => dispatch(userHasLoggedOut())
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Navbar)
